import React, { Component } from 'react';


export default class Payment extends Component {
    constructor(props){
        super(props)
        this.state = {
          name: '',
          cardNumber: '',
          expirationMonth: '',
          expirationYear: '',
          CVV: ''
        }
      }
    render() { 


        return ( 
        <div>
            <h3>Payment Info</h3>
            <span>Payment Method</span>
        </div>
         );
    }
}
